code_examples.example:
# Command :- ::ixiangpf::emulation_ospf_config
# This example will add a OSPFv2 Router
set ospf_neighbor_status [::ixiangpf::emulation_ospf_config \ -handle <ipv4_1_handle> \ -session_type ospfv2 \ -mode create \ -intf_ip_addr 100.1.1.1 \ -intf_ip_addr_step 0.0.1.0 \ -neighbor_intf_ip_addr 0.0.1.0 \ -neighbor_intf_ip_addr_step 0.0.0.1 \ -neighbor_router_id 100.100.0.1 \ -area_id 0.0.255.255 \ -area_id_step 0.0.0.1 \ -router_priority 1 \ -router_id 10.0.1.0 \ -router_id_step 0.0.0.1 \ -router_active 0 \ ]
# The command above will generate output as shown below: # {status 1} {ospfv2_handle ospfv2Handle}
# This example will add a OSPFv3 Router
set ospfv3_1_status [::ixiangpf::emulation_ospf_config \ -handle <ipv6_1_handle> \ -area_id 0.0.0.0 \ -area_id_as_number 0 \ -area_id_type area_id_as_number \ -dead_interval 40 \ -session_type ospfv3 \ -demand_circuit 0 \ -hello_interval 10 \ -router_interface_active 1 \ -enable_fast_hello 0 \ -hello_multiplier 2 \ -protocol_name {OSPFv3-IF 1} \ -router_active 1 \ -router_asbr 0 \ -do_not_generate_router_lsa 0 \ -router_abr 0 \ -lsa_refresh_time 1800 \ -lsa_retransmit_time 5 \ ]
# The command above will generate output as shown below: # {status 1} {ospfv3_handle ospfv3Handle}
# This example will modify a OSPF router
set ospfv2_modified [::ixiangpf::emulation_ospf_config \ -handle <ospfv2_handle> \ -mode modify \ -router_active 0 \ ]
# The command above will generate output as shown below: # {status 1}
